  false,\n\t\"url\": null,\n\t\"notes\": \"Canada geese use four divisions of the
  Mark Twin NWR: Louisa, Delair, Cannon, and Calhoun. There was a shortage of cultivated
  crops, corn and soybeans, on all refuge units except the Delair which had crops
  approaching normal. Lack of food had little effect on Canada goose populations as
  three of the four units had significantly greater use than in 1968 when food supplies
  were abundant to the point of being surplus. The specific behavior of Canada geese
  on each division is outlined in this report.\",\n\t\"license_title\": \"License
